    <tr>
        <td style="border-left: 1px solid #000000; border-right: 1px solid #000000" colspan="65" align="left"><b><font face="Arial Narrow">Se entenderá por "Beneficiario Controlador" / "Dueño Beneficiario", a la persona o grupo de personas que:</font></b></td>
    </tr>
    <tr>
        <td style="border-left: 1px solid #000000; border-right: 1px solid #000000" colspan="65" align="left"><font face="Arial Narrow" size="1">a) Por medio de otra o de cualquier otro acto, obtiene el beneficio derivado de éstos y es quien, en última instancia, ejerce los derechos de uso, goce, disfrute, aprovechamiento o disposición de un bien o servicio, o</font></td>
    </tr>
    <tr>
        <td style="border-left: 1px solid #000000; border-right: 1px solid #000000" colspan="65" align="left"><font face="Arial Narrow" size="1">b) Ejerce el control de aquella persona moral que, en su carácter de cliente o usuario, lleve acabo actos u operaciones con quien realice Actividades Vulnerables, así como las personas por cuenta de quienes celebra alguno de ellos,</font></td>
    </tr>
    <tr>
        <td style="border-left: 1px solid #000000; border-right: 1px solid #000000" colspan="65" align="left"><b><font face="Arial Narrow" size="1">Se entiende que una persona o grupo de personas controla a una persona moral cuando a través de la titularidad de valores, por contrato o de cualquier acto, puede:</font></b></td>
    </tr>
    <tr>
        <td style="border-left: 1px solid #000000; border-right: 1px solid #000000" colspan="65" align="left"><font face="Arial Narrow" size="1">i) Imponer directa o indirectamente, decisiones en las asambleas generales de accionistas, socios u órganos equivalentes, o nombrar o destituir a la mayoría de los consejeros, administradores o sus equivalentes;</font></td>
    </tr>
    <tr>
        <td style="border-left: 1px solid #000000; border-right: 1px solid #000000" colspan="65" align="left"><font face="Arial Narrow" size="1">ii) Mantener la titularidad de los derechos que permitan, directa o indirectamente, ejercer el voto respecto de más del cincuenta porciento del capital social, o</font></td>
    </tr>
    <tr>
        <td style="border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: 1px solid #000000" colspan="65" align="left"><font face="Arial Narrow" size="1">iii) Dirigir directa o indirectamente, la administración, la estrategia o las principales políticas de la misma.</font></td>
    </tr>
    <tr>
        <td style="border-top: 1px solid #000000; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: 1px solid #000000" colspan="65" align="left" valign="middle" bgcolor="#BFBFBF"><b><font face="Arial Narrow">En caso de manifestar "Beneficiario Controlador" / "Dueño Beneficiario", favor de llenar el formato de Identidad de Participantes</font></b></td>
    </tr>
    <tr>
        <td style="border-top: 1px solid #000000; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: 1px solid #000000" colspan="65" align="justify" valign="middle"><b><font face="Arial Narrow" size="1">AUTORIZACIÓN DE DESTRUCCIÓN DE DOCUMENTOS: Quienes participamos en la presente solicitud, otorgamos nuestro consentimiento al Fondo Jalisco de Fomento Empresarial para que proceda a la destrucción total de la documentación entregada para el trámite de crédito, incluyendo los documentos que puedan contener nuestros datos personales; lo anterior, una vez transcurrido un mes de su entrega y sin perjuicio de que proceda o no el otorgamiento del crédito que nos ocupa.</font></b></td>
    </tr>
    <tr>
        <td style="border-top: 1px solid #000000; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: 1px solid #000000" colspan="65" align="justify" valign="middle"><font face="Arial Narrow" size="1">Los firmantes de la presente solicitud de crédito manifiestan su conformidad con las siguientes condiciones:<br>1) El trámite de crédito se considerará iniciado cuando el expediente esté completo y correcto conforme a lo solicitado, se cuente con pre-validación positiva del proyecto y recomendación favorable derivada de la visita al negocio.<br>2) De otorgarse el crédito, del monto total del financiamiento se descontará la Comisión por Apertura; para reestructuras de crédito dicha Comisión deberá pagarse previo a la formalización.<br>3) Dentro de los 90 días siguientes a la operación del crédito, el acreditado deberá comprobar documentalmente su inversión.<br>4) De presentar Garantía Hipotecaria y para dar cumplimiento a lo dispuesto en los artículos 99 y 100 de la Ley del Registro Público de la Propiedad y 87 de la Ley del Notariado, se autoriza al Notario Público que FOJAL designe, a ejecutar el envío al Registro Público de la Propiedad, la anotación del aviso cautelar y la inmovilización de la inscripción de la propiedad por el término de 45 días hábiles a partir de la presentación de dicho aviso, a efecto de formalizar la escritura pública que contenga el contrato de crédito solicitado.</font></td>
