        <td style="border-top: 1px solid #000000; border-left: 1px solid #000000; border-right: 1px solid #000000" colspan="65" rowspan="2" align="justify" valign="middle"><b><font face="Arial Narrow" size="1">DECLARO, BAJO PROTESTA DE DECIR VERDAD que los datos asentados en la presente, son veraces y que al igual que los documentos anexos, pueden ser verificados en cualquier momento por el Fondo Jalisco de Fomento Empresarial, aceptando que de existir falsedad o falsificación, se cancele el trámite y se proceda conforme a derecho. Los involucrados en esta solicitud están enterados de los delitos en que incurrirán al presentar documentación inexacta o falsa con el objeto de obtener un crédito o financiamiento, de conformidad con el artículo 112 de la Ley de Instituciones de Crédito y 98 de la Ley General de Organizaciones y Actividades Auxiliares del Crédito. En caso de interponer Garantía Hipotecaria y para dar cumplimiento a lo dispuesto en los artículos 99 y 100 de la ley del registro público de la propiedad y del art. 87 de la ley del notariado en vigor, autorizo expresamente al notario público que Fojal designe, a ejecutar el envío al registro público de la propiedad, la anotación del aviso cautelar y la inmovilización de la inscripción de la propiedad por el término de 45 días hábiles a partir de la presentación de dicho aviso, a efecto de formalizar la escritura pública que contenga el contrato de crédito solicitado, situación con la que manifiesto totalmente mi conformidad.</font></b></td>
